export const ExtractVerein = (
  club,
  vereinsName: string,
  vereinsKurz: string,
  vereinsStrasse: string,
  vereinsPLZ: string,
  vereinsOrt: string,
  vereinsTelefon: string,
  vereinsBank: string,
  vereinsKontoInhaber: string,
  vereinsKontoInhaberAdresse: string,
  vereinsIBAN: string,
  vereinsBIC: string
) => {
  for (const property in club) {
    switch (String(property)) {
      case "verein_name":
        vereinsName = club[property];
        break;
      case "verein_kurz":
        vereinsKurz = club[property];
        break;
      case "verein_strasse":
        vereinsStrasse = club[property];
        break;
      case "verein_plz":
        vereinsPLZ = club[property];
        break;
      case "verein_ort":
        vereinsOrt = club[property];
        break;
      case "verein_telefon_privat":
        vereinsTelefon = club[property];
        break;
      case "verein_bankname":
        vereinsBank = club[property];
        break;
      case "verein_konto_inhaber":
        vereinsKontoInhaber = club[property];
        break;
      case "verein_ki_anschrift":
        vereinsKontoInhaberAdresse = club[property];
        break;
      case "verein_iban":
        vereinsIBAN = club[property];
        break;
      case "verein_bic":
        vereinsBIC = club[property];
        break;
      default:
        //console.log("Feld nicht zugewiesen");
        break;
    }
  }
  return {
    vereinsName,
    vereinsKurz,
    vereinsStrasse,
    vereinsPLZ,
    vereinsOrt,
    vereinsTelefon,
    vereinsBank,
    vereinsKontoInhaber,
    vereinsKontoInhaberAdresse,
    vereinsIBAN,
    vereinsBIC,
  };
};
